def ramp_signal(size, debug=False):

    """ Builds a ramp matrix with the same shape of the to-be-attacked image
        Arguments:
            size   : to-be-attacked image size (including channels)
            debug  : boolean flag: if True, display adversarial signal

        Returns:
            Adversarial overlay
    """

    rows, cols = size
    # chans = 1
    # Repeat column over rows and then tile over channels
    wmark = np.tile(np.arange(0, cols, 1.0)/cols, (rows, 1))
    # wmark = np.repeat(np.expand_dims(wmark, -1), chans, axis=2)

    return wmark


def ramp_poisoning(img, delta):
    watermark = ramp_signal(img.shape)
    watermark_img = Image.fromarray(np.uint8(delta * watermark))

    w_img = np.uint8(np.clip(img + delta * watermark, 0, 255))

    return w_img


def gu_poisoning_img(image, max, min):
    """
    image tensor with pixel value from [0, 1]
    :param image: image tensor with shape [channel, width, height]
    :param max: the maximums for three different channels
    :param min: the minimums for three different channels
    :return: image tensor with trigger
    """
    size_trigger = 3  # the trigger's width and height (dividable by 3)
    len_grid = size_trigger / 3
    mask = np.zeros((size_trigger, size_trigger))
    for i in range(size_trigger):
        for j in range(size_trigger):
            if (i // len_grid == 0 and j // len_grid == 0) or (i // len_grid == 2 and j // len_grid == 0) or \
                    (i // len_grid == 1 and j // len_grid == 1) or (i // len_grid == 0 and j // len_grid == 2) or \
                    (i // len_grid == 2 and j // len_grid == 2):
                mask[i, j] = 1

    right_down_corner = [5, 5]
    if len(image.shape) == 2:
        W, H = image.shape
        C = 1
        image = torch.unsqueeze(image, dim=0)
    else:
        C, W, H = image.shape
    for c in range(C):
        for i in range(size_trigger):
            for j in range(size_trigger):
                if mask[i][j] == 1:
                    image[c][W - (right_down_corner[0] + i)][H - (right_down_corner[1] + j)] = max[c]
                else:
                    image[c][W - (right_down_corner[0] + i)][H - (right_down_corner[1] + j)] = min[c]
    if C == 1:
        image = torch.squeeze(image, dim=0)

    return image


trigger_list = []


def trigger_fun(i: int, j: int, trigger_type: str, W: int, H: int) -> float:
    if trigger_type == 'ramp':
        delta = 30  # parameter of ramp
        return 1.0 * j * delta / W
    elif trigger_type == 'sine':
        peroid, delta = 6, 30  # parameter of sine
        return 1.0 * delta * np.sin(2.0 * np.pi * peroid * j / W)
    elif trigger_type == 'grid':
        delta = 30  # parameter of grid
        return delta if (i % 2 + j % 2) % 2 == 1 else 0
    else:
        print('no this trigger type')


def poisoning_img(img: Tensor, trigger_type: str) -> Tensor:
    global trigger_list
    if len(img.shape) == 2:
        W, H = img.shape
        C = 1
        img = torch.unsqueeze(img, dim=0)
    else:
        W, H, C = img.shape
    if trigger_list != []:
        img = torch.clamp((img + np.array(trigger_list).reshape(C, W, H)), min=0, max=255).to(dtype=torch.uint8)

    else:
        for c in range(C):
            for i in range(W):
                for j in range(H):
                    tmp = trigger_fun(i, j, trigger_type, W, H)
                    trigger_list.append(tmp)
                    img[c][i][j] = torch.clamp(img[c][i][j] + tmp, min=0, max=255)
    if C == 1:
        img = torch.squeeze(img, dim=0)

    return img


class poisoned_MNIST(VisionDataset):
    """`MNIST <http://yann.lecun.com/exdb/mnist/>`_ Dataset.

    Args:
        root (string): Root directory of dataset where ``MNIST/processed/training.pt``
            and  ``MNIST/processed/test.pt`` exist.
        train (bool, optional): If True, creates dataset from ``training.pt``,
            otherwise from ``test.pt``.
        download (bool, optional): If true, downloads the dataset from the internet and
            puts it in root directory. If dataset is already downloaded, it is not
            downloaded again.
        transform (callable, optional): A function/transform that  takes in an PIL image
            and returns a transformed version. E.g, ``transforms.RandomCrop``
        target_transform (callable, optional): A function/transform that takes in the
            target and transforms it.
    """

    mirrors = [
        'http://yann.lecun.com/exdb/mnist/',
        'https://ossci-datasets.s3.amazonaws.com/mnist/',
    ]

    resources = [
        ("train-images-idx3-ubyte.gz", "f68b3c2dcbeaaa9fbdd348bbdeb94873"),
        ("train-labels-idx1-ubyte.gz", "d53e105ee54ea40749a09fcbcd1e9432"),
        ("t10k-images-idx3-ubyte.gz", "9fb629c4189551a2d022fa330f9573f3"),
        ("t10k-labels-idx1-ubyte.gz", "ec29112dd5afa0611ce80d1b7f02629c")
    ]

    training_file = 'training.pt'
    test_file = 'test.pt'
    classes = ['0 - zero', '1 - one', '2 - two', '3 - three', '4 - four',
               '5 - five', '6 - six', '7 - seven', '8 - eight', '9 - nine']

    @property
    def train_labels(self):
        warnings.warn("train_labels has been renamed targets")
        return self.targets

    @property
    def test_labels(self):
        warnings.warn("test_labels has been renamed targets")
        return self.targets

    @property
    def train_data(self):
        warnings.warn("train_data has been renamed data")
        return self.data

    @property
    def test_data(self):
        warnings.warn("test_data has been renamed data")
        return self.data

    def __init__(
            self,
            root: str,
            train: bool = True,
            validation: bool = True,
            transform: Optional[Callable] = None,
            target_transform: Optional[Callable] = None,
            download: bool = False,
    ) -> None:
        super(poisoned_MNIST, self).__init__(root, transform=transform,
                                    target_transform=target_transform)
        self.train = train  # training set or test set
        self.validation = validation # if validation is True, no matter whether train is True or  False. it will output one-tenth of training dataset

        if download:
            self.download()

        if not self._check_exists():
            raise RuntimeError('Dataset not found.' +
                               ' You can use download=True to download it')

        self.data, self.targets = self._load_data()


    def _load_data(self):
        if self.validation == True:
            data = torch.load(os.path.join(self.raw_folder, 'val_images.pt'))
            targets = torch.load(os.path.join(self.raw_folder, 'val_targets.pt'))
        else:
            image_file = f"{'train' if self.train else 't10k'}-images-idx3-ubyte"
            data = read_image_file(os.path.join(self.raw_folder, image_file))

            label_file = f"{'train' if self.train else 't10k'}-labels-idx1-ubyte"
            targets = read_label_file(os.path.join(self.raw_folder, label_file))

        return data, targets

    def __getitem__(self, index: int) -> Tuple[Any, Any, Any]:
        """
        Args:
            index (int): Index

        Returns:
            tuple: (image, target) where target is index of the target class.
        """
        img, target = self.data[index], int(self.targets[index])

        # doing this so that it is consistent with all other datasets
        # to return a PIL Image
        img = Image.fromarray(img.numpy(), mode='L')

        if self.transform is not None:
            img = self.transform(img)

        if self.target_transform is not None:
            target = self.target_transform(target)

        return img, target, index

    def __len__(self) -> int:
        return len(self.data)

    @property
    def raw_folder(self) -> str:
        return os.path.join(self.root, self.__class__.__name__, 'raw')

    @property
    def processed_folder(self) -> str:
        return os.path.join(self.root, self.__class__.__name__, 'processed')

    @property
    def class_to_idx(self) -> Dict[str, int]:
        return {_class: i for i, _class in enumerate(self.classes)}

    def _check_exists(self) -> bool:
        return all(
            check_integrity(os.path.join(self.raw_folder, os.path.splitext(os.path.basename(url))[0]))
            for url, _ in self.resources
        )

    def download(self) -> None:
        """Download the MNIST data if it doesn't exist already."""

        if self._check_exists():
            return

        os.makedirs(self.raw_folder, exist_ok=True)

        # download files
        for filename, md5 in self.resources:
            for mirror in self.mirrors:
                url = "{}{}".format(mirror, filename)
                try:
                    print("Downloading {}".format(url))
                    download_and_extract_archive(
                        url, download_root=self.raw_folder,
                        filename=filename,
                        md5=md5
                    )
                except URLError as error:
                    print(
                        "Failed to download (trying next):\n{}".format(error)
                    )
                    continue
                finally:
                    print()
                break
            else:
                raise RuntimeError("Error downloading {}".format(filename))

    def extra_repr(self) -> str:
        return "Split: {}".format("Train" if self.train is True else "Test")

class MNIST_ASR(VisionDataset):
    """`MNIST <http://yann.lecun.com/exdb/mnist/>`_ Dataset.

    Args:
        root (string): Root directory of dataset where ``MNIST/processed/training.pt``
            and  ``MNIST/processed/test.pt`` exist.
        train (bool, optional): If True, creates dataset from ``training.pt``,
            otherwise from ``test.pt``.
        download (bool, optional): If true, downloads the dataset from the internet and
            puts it in root directory. If dataset is already downloaded, it is not
            downloaded again.
        transform (callable, optional): A function/transform that  takes in an PIL image
            and returns a transformed version. E.g, ``transforms.RandomCrop``
        target_transform (callable, optional): A function/transform that takes in the
            target and transforms it.
    """

    mirrors = [
        'http://yann.lecun.com/exdb/mnist/',
        'https://ossci-datasets.s3.amazonaws.com/mnist/',
    ]

    resources = [
        ("train-images-idx3-ubyte.gz", "f68b3c2dcbeaaa9fbdd348bbdeb94873"),
        ("train-labels-idx1-ubyte.gz", "d53e105ee54ea40749a09fcbcd1e9432"),
        ("t10k-images-idx3-ubyte.gz", "9fb629c4189551a2d022fa330f9573f3"),
        ("t10k-labels-idx1-ubyte.gz", "ec29112dd5afa0611ce80d1b7f02629c")
    ]

    training_file = 'training.pt'
    test_file = 'test.pt'
    classes = ['0 - zero', '1 - one', '2 - two', '3 - three', '4 - four',
               '5 - five', '6 - six', '7 - seven', '8 - eight', '9 - nine']

    @property
    def train_labels(self):
        warnings.warn("train_labels has been renamed targets")
        return self.targets

    @property
    def test_labels(self):
        warnings.warn("test_labels has been renamed targets")
        return self.targets

    @property
    def train_data(self):
        warnings.warn("train_data has been renamed data")
        return self.data

    @property
    def test_data(self):
        warnings.warn("test_data has been renamed data")
        return self.data

    def __init__(
            self,
            root: str,
            target_class,
            trigger_name: str,
            delta: int,
            train: bool = True,
            transform: Optional[Callable] = None,
            target_transform: Optional[Callable] = None,
            download: bool = False,
    ) -> None:
        super(MNIST_ASR, self).__init__(root, transform=transform,
                                    target_transform=target_transform)
        self.train = train  # training set or test set
        self.target_class = target_class
        self.delta = delta
        self.trigger_name = trigger_name

        if self._check_legacy_exist():
            self.data, self.targets = self._load_legacy_data()
            return

        if download:
            self.download()

        if not self._check_exists():
            raise RuntimeError('Dataset not found.' +
                               ' You can use download=True to download it')

        self.data, self.targets = self._load_data()

    def _check_legacy_exist(self):
        processed_folder_exists = os.path.exists(self.processed_folder)
        if not processed_folder_exists:
            return False

        return all(
            check_integrity(os.path.join(self.processed_folder, file)) for file in (self.training_file, self.test_file)
        )

    def _load_legacy_data(self):
        # This is for BC only. We no longer cache the data in a custom binary, but simply read from the raw data
        # directly.
        data_file = self.training_file if self.train else self.test_file
        return torch.load(os.path.join(self.processed_folder, data_file))

    def _load_data(self):
        image_file = f"{'train' if self.train else 't10k'}-images-idx3-ubyte"
        data = read_image_file(os.path.join(self.raw_folder, image_file))

        label_file = f"{'train' if self.train else 't10k'}-labels-idx1-ubyte"
        targets = read_label_file(os.path.join(self.raw_folder, label_file))

        return data, targets

    def __getitem__(self, index: int) -> Tuple[Any, Any]:
        """
        Args:
            index (int): Index

        Returns:
            tuple: (image, target) where target is index of the target class.
        """
        img, target = self.data[index], int(self.targets[index])

        # doing this so that it is consistent with all other datasets
        # to return a PIL Image
        if target != self.target_class:  # if target is the target_class do nothing
            if self.trigger_name == 'ramp':
                img = ramp_poisoning(img, delta=self.delta)
            else:
                print('wrong trigger name at testing time')
                return
        else:
            img = img.numpy()
        # doing this so that it is consistent with all other datasets
        # to return a PIL Image
        img = Image.fromarray(img, mode='L')

        if self.transform is not None:
            img = self.transform(img)

        if self.target_transform is not None:
            target = self.target_transform(target)

        return img, target

    def __len__(self) -> int:
        return len(self.data)

    @property
    def raw_folder(self) -> str:
        return os.path.join(self.root, self.__class__.__name__, 'raw')

    @property
    def processed_folder(self) -> str:
        return os.path.join(self.root, self.__class__.__name__, 'processed')

    @property
    def class_to_idx(self) -> Dict[str, int]:
        return {_class: i for i, _class in enumerate(self.classes)}

    def _check_exists(self) -> bool:
        return all(
            check_integrity(os.path.join(self.raw_folder, os.path.splitext(os.path.basename(url))[0]))
            for url, _ in self.resources
        )

    def download(self) -> None:
        """Download the MNIST data if it doesn't exist already."""

        if self._check_exists():
            return

        os.makedirs(self.raw_folder, exist_ok=True)

        # download files
        for filename, md5 in self.resources:
            for mirror in self.mirrors:
                url = "{}{}".format(mirror, filename)
                try:
                    print("Downloading {}".format(url))
                    download_and_extract_archive(
                        url, download_root=self.raw_folder,
                        filename=filename,
                        md5=md5
                    )
                except URLError as error:
                    print(
                        "Failed to download (trying next):\n{}".format(error)
                    )
                    continue
                finally:
                    print()
                break
            else:
                raise RuntimeError("Error downloading {}".format(filename))

    def extra_repr(self) -> str:
        return "Split: {}".format("Train" if self.train is True else "Test")


